import React from 'react';
import { useLocation } from 'react-router-dom';

export default function ResultsPage() {
  const location = useLocation();
  const results = location.state?.results || [];

  return (
    <div style={{ padding: '6rem 2rem 2rem 2rem', color: '#fff' }}>
      <h2>Search Results</h2>
      {results.length === 0 ? (
        <p>No results found.</p>
      ) : (
        <ul>
          {results.map((home, idx) => (
            <li key={idx} style={{ marginBottom: 24 }}>
              <div>
                <b>{home.address}</b> - {home.price}
              </div>
              <a
                href={`https://www.google.com/maps/search/?api=1&query=${encodeURIComponent(home.address)}`}
                target="_blank"
                rel="noopener noreferrer"
                style={{ color: '#7ecbff' }}
              >
                View on Google Maps
              </a>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
